/// <summary>
/// Inserts a record into the <c>RetailMassUpdateWorksheetLine</c> table which are selected on the add
/// products form.
/// </summary>
/// <param name="_massUpdateTableRecId">
/// The record ID of a selected worksheet.
/// </param>
/// <param name="_productsToAdd">
/// The selected products on the add products form.
/// </param>
public void insertFromAddProducts(RefRecId _massUpdateTableRecId, TmpRetailProductsToAdd _productsToAdd)
{
    while select _productsToAdd
    {
        ttsBegin;

        if (!RetailMassUpdateWorksheetLine::findItemId(InventTable::findByProduct(_productsToAdd.EcoResProduct).ItemId, _massUpdateTableRecId))
        {
            this.RetailMassUpdateWorksheetTable = _massUpdateTableRecId;
            this.ItemId = InventTable::findByProduct(_productsToAdd.EcoResProduct).ItemId;
            this.EcoResProductRecId = _productsToAdd.EcoResProduct;
            this.EcoResProductTranslation = EcoResProductTranslation::findByProductLanguage(_productsToAdd.EcoResProduct, Global::currentUserLanguage()).RecId;
            this.insert();
        }
        _productsToAdd.delete();

        ttsCommit;
    }
}

/// <summary>
/// This method returns the product name in the current user's language.
/// </summary>
/// <returns>
/// A string of <c>EcoResProductName</c> type.
/// </returns>
display EcoResProductName productName()
{
    return EcoResProductTranslation::findByProductLanguage(InventTable::find(this.ItemId).Product, Global::currentUserLanguage()).Name;
}

/// <summary>
/// This method is called whenever a record is updated in <c>RetailMassUpdateWorksheetLine</c> table.
/// </summary>
/// <remarks>
/// Changes the status of corresponding record in <c>RetailMassUpdateWorksheetTable</c> table's status to open.
/// </remarks>
public void update()
{
    RetailMassUpdateWorksheetLine   oldWorkSheetLine = this.orig();
    RetailMassUpdateWorksheetTable  workSheetTable;
    Object  fds;

    super();

    if (this.workSheetTable().Status == RetailMassUpdateStatus::Validated
        && !oldWorkSheetLine.equal(this))
    {
        ttsBegin;
        workSheetTable = this.workSheetTable(true);
        workSheetTable.Status = RetailMassUpdateStatus::Open;
        workSheetTable.update();
        ttsCommit;

        // refresh table datasource after changing the status.
        if (FormDataUtil::isFormDataSource(this))
        {
            if (formDataSourceHasMethod(FormDataUtil::getFormDataSource(this), identifierStr(refreshTableDS)))
            {
                fds = FormDataUtil::getFormDataSource(this);
                fds.refreshTableDS();
            }
        }
    }
}

