/// <summary>
/// Finds a record of <c>RetailMassUpdateWorksheetLine</c> table.
/// </summary>
/// <param name="_ItemId">
/// Value to be searched in the field <c>ItemId</c> of <c>RetailMassUpdateWorksheetLine</c> table.
/// </param>
/// <param name="_massUpdateTableRecId">
/// Record ID of the associated record of<c>RetailMassUpdateWorksheetTable</c> table.
/// </param>
/// <param name="_forUpdate">
/// Defines whether the found record is to be updated or not.Optional parameter.
/// </param>
/// <returns>
/// A record of <c>RetailMassUpdateWorksheetLine</c> table.
/// </returns>
public static RetailMassUpdateWorksheetLine findItemId(ItemId _ItemId,
                                                        RefRecId _massUpdateTableRecId,
                                                        boolean _forUpdate = false)
{
    RetailMassUpdateWorksheetLine  worksheetLine;

    if (_ItemId && _massUpdateTableRecId)
    {
        worksheetLine.selectForUpdate(_forUpdate);

        select firstonly worksheetLine
            where worksheetLine.ItemId == _ItemId &&
                worksheetLine.RetailMassUpdateWorksheetTable == _massUpdateTableRecId;
    }

    return worksheetLine;
}

private boolean validateAttribute(FieldId _fieldIdToCheck)
{
    RefRecId    attribute;

    attribute = this.(_fieldIdToCheck);
    if (!RetailInventTable::isValidAttributeForItem(this.ItemId, attribute))
    {
        return checkFailed(strFmt("@SYP4881070", EcoResAttribute::find(attribute).Name));
    }

    return true;
}

