    ret = super(_fieldIdToCheck);

    switch (fieldExt2Id(_fieldIdToCheck))
    {
        //<GEERU>
        case fieldNum(RetailMassUpdateWorksheetLine, RetailInvent_LabelAttribute1):
        case fieldNum(RetailMassUpdateWorksheetLine, RetailInvent_LabelAttribute2):
        case fieldNum(RetailMassUpdateWorksheetLine, RetailInvent_LabelAttribute3):
        case fieldNum(RetailMassUpdateWorksheetLine, RetailInvent_LabelAttribute4):
        case fieldNum(RetailMassUpdateWorksheetLine, RetailInvent_LabelAttribute5):
            ret = this.validateAttribute(_fieldIdToCheck);
            break;
        //</GEERU>
    }

    return ret;
}
